import { Row, Col, Button, Layout } from 'antd';
function Home() {
  return (
    <>
      <Row
        align="center"
        justify="center"
        style={{
          margin: '0 0 1em 0',
          padding: '1em 0 1em 0',
          backgroundColor: 'lightblue',
        }}
      >
        <Col></Col>
        <Col offset={21} style={{}}>
          <Button type="danger">APP</Button>
        </Col>
      </Row>
    </>
  );
}

export default Home;
